INSERT INTO `AgendaList` VALUES (1,'2nd meeting',5,'<OL>\r\n<LI> Begin meeting\r\n<LI> Welcome, agenda review, agenda additions\r\n<LI> Work through the suggested classes, adding as necessary, and discussing (Limited to 20 Minutes.)\r\n<LI> Establish the task list, separated by working groups\r\n<LI> Wrap-up, final notes\r\n</OL>','<DL>\r\n<DT>Begin meeting</DT>\r\n<DD>Attending:\r\nBendy, Em, Kate, Kyle, Buddy, Jay, GirlMouse, Pollo, Percy, Courtney<DD>\r\n<DT>Welcome, agenda review, agenda additions</DT>\r\n<DD>\r\n<UL>\r\n<LI>Em: Promotions stuff. Zambia: 207\r\n<LI>Kate: Access to Zambia: 272\r\n<LI>Jay: Access to Zambia: 147\r\n</UL>\r\n</DD>\r\n<DT>Department Reports</DT>\r\n<DD>\r\n<UL>\r\n<LI>Liaison: 31 presenters, 3 not fully confirmed.\r\n<LI>Promotins: Postcard, Headline presenters, Headline classes, Twitter, Fetlife.  Em in touch with DJ Pet (Bendy).  Access to Both Twitter Account (Bendy).  Add on Fetlife.  Distribute Cards.  Add swap with vendors, for their sites.  Banner Exchange.  Pass via Viv.\r\n<LI>Photo Lounge: Wrangling big screens, for Sunday.\r\n<LI>Program Book details: 8.5x11, 2 weekend admissions, 2 associatships, 2 entrances to Fri and Sat events (Model releases, etc)\r\n<LI>Volunteers: Programming Volunteers go to Pollo.  Paper records for what people have done before the event to Pollo and Percy.\r\n</UL>\r\n</DD>\r\n<DT>Work through the suggested classes, adding as necessary, and discussing (Limited to 20 Minutes.)</DT>\r\n<DD>Gone through <A HREF=\"http://www.nelaonline.org/FFF-NE-38/webpages/genreport.php?reportname=programcomment\">Overall Programming Commentary</A> and migrated the classes over.  Everyone will go through <A HREF=\"http://www.nelaonline.org/FFF-NE-38/webpages/genreport.php?reportname=brainstormsubmissions\">Brainstorm Submissions</A> and talk about them on the email list fff38-programming@nelaonline.org over the next week.  Looking for holes in the programming to make it balanced.  Then we get to start working through which classes match our presenters.  If there are presenters class lists discovered, let Em know.</DD>\r\n<DT>Establish the task list, separated by working groups</DT>\r\n<DD>Discussing Job areas, and job descriptions.  Please get a written description of jobs to be put into Zambia (not for public consumption, but for understanding for our staffing).  Break up, and discussion.  People will add/insert tasks.</DD>\r\n<DT>Class Length</DT>\r\n<DD>1:30, with 15 between, counted as 1:45 for volunteering.</DD>\r\n<DT>Wrap-up, final notes</DT>\r\n<DD>Add the roles to the Staff Front Page</DD>\r\n</OL>','2011-10-06'),(2,'1st meeting',5,'<OL>\r\n  <LI> Changes from last year\r\n  <LI> Teams and their captains\r\n  <LI> Scheduling forecasts\r\n  <LI> Budget\r\n  <LI> Task List\r\n  <LI> Zambia Familiarization\r\n</OL>','<OL>\r\n  <LI> Changes from last year\r\n  <UL>\r\n    <LI> Essence not changing, some details will\r\n    <LI> Security Detail all night (not us)\r\n    <LI> Each lounge running one day (4 lounges, 2 days)\r\n    <UL>\r\n      <LI> Maureen (hopeful) - ponies\r\n      <LI> Domino and Dee (confirmed verbally) - Whip Lounge\r\n      <LI> Jay (Percy\'s got to talk to Matthew Jay confirmed verbally) - Bondage Lounge\r\n      <LI> Jay (confirmed verbally) - Photo gallery/lounge\r\n    </UL>\r\n    <LI> New tracks (Remember this is an intro event)\r\n  </UL>\r\n  <LI> Teams and their captains\r\n  <UL>\r\n    <LI> Div Head - Percy Deputy Kyle\r\n    <LI> Programming Volunteer Wrangler - Mike Deputy girlMouse\r\n    <LI> Speaker Liaison - Bendy Deputy Courtney, Sweet Wisteria\r\n    <LI> Green Room Food - Kat Deputy girlMouse\r\n             Snack food, not meals, crock-pot food (chowder, stew, potroast) big candy bowl\r\n     <LI> Logistics - William\r\n     <LI> Publications - Mike and Em (electronic and paper)\r\n     <LI> Admin - Sweet Wisteria\r\n     <LI> Promotions - Naughty Em\r\n     <LI> Recruiting - Buddy Deputy Kat\r\n     <LI> Lounge Liaison - Jay Deputy Tori\r\n  </UL>\r\n  <LI> Scheduling forecasts\r\n  <UL>\r\n    <LI> End of October - Out of Town Presenters\r\n    <UL>\r\n      <LI> Bendy needs to know of anyone missing by 9/8\r\n      <LI> BostonDSM, Bendy and Percy work on this over MsC\r\n      <LI> Presentation of who/budget, etc to date (separate spreadsheet)\r\n      <UL>\r\n         <LI> Room Cost ($157 + taxes and fees, like last year)\r\n         <LI> Travelers Honeraria\r\n         <LI> Travel costs (RI/MA/NH/VT/ME/CT/NY/further afield)\r\n         <LI> 1/2 Room Night per class is the compensation\r\n         <LI> Panels are considered \"Volunteer Time\" and count toward volunteer awards, such as admission, membership, etc.\r\n      </UL>\r\n    </UL>\r\n    <LI> End of November - In Town Presenters\r\n    <LI> End of December - Schedule locked down\r\n    <LI> Mid January - Panelists set\r\n    <LI> January Meeting - At Con Volunteers trained\r\n    <LI> End of February - Feedback and Thank yous\r\n  </UL>\r\n  <LI> Task List\r\n  <UL>\r\n    <LI> Should be utilized more this time around (wasn\'t started until just before con-time last time around)\r\n    <LI> <A HREF=\"genreport.php?reportname=tasklistdisplay\">Task List Report</A>\r\n  </UL>\r\n  <LI> Zambia Familiarization\r\n</OL>','2011-09-01'),(3,'2nd Meeting',2,'<OL>\r\n  <LI> Volunteers\r\n  <LI> Vendors\r\n  <LI> Hotel\r\n  <LI> Security\r\n  <LI> Sponsorship candidate search update\r\n  <LI> Programming\r\n  <LI> Program book\r\n  <LI> Webmaster issues\r\n  <LI> Evening Plans\r\n  <LI> Outside People\r\n</OL>','<DL>\r\n  <DT>Volunteers</DT>\r\n  <DD>Everything is on target, Kerry is learning Zambia, and will teach Jack when all is ready.</DD>\r\n  <DT>Vendors</DT>\r\n  <DD>Going with Google Docs format.  Vendors are open, as of the 3rd of October.  Leather Lee ... prohibition with letter, if we accept him.  4th and 5th, with the fifth as an artists corridor.  Recruit the artists, and the like, for the room, crafter fee, instead of the vendor fee.  Open Studios.</DD>\r\n  <DT>Hotel</DT>\r\n  <DD>Check-in happened, no change in floor-plan, if not booked, we can get in at 1.  No guarentee that we can.  Restaurant is to be reminded.<DD>\r\n  <DT>Security</DT>\r\n  <DD>Danny has yet to get in touch with Jerry.  Fallback Percy.  At least 8 people, give them 2 rooms.  DJ Pet near there.</DD>\r\n  <DT>Sponsorship candidate search update</DT>\r\n  <DD>Add person, 5 or 6 picked, the rest gently eased out.  Stock interview for all candidtates, decision by October 15th.  Numbers/percentage recreated.</DD>\r\n  <DT>Programming</DT>\r\n  <DD>Program AV?  Budget emailed out to Viv and Scott.  Teasers up on the site.  Moth Storytelling.  Erotic Readings.  Dr. Sketchies.</DD>\r\n  <DT>Program book</DT>\r\n  <DD>Allegra printing contact will be passed to Pollo.  Reward offered for the cover-art, guidance from the save-the-date (2 of: Entrance to the FFF, Associateship, Package, T-shirts?).  Full size printing.  Good options for advertising.  Moving forward soon.  Suggested map of restaurants, that are advertising with us.  Possibly coupons or adds around the side.  Publication deadlines to be determined.</DD>\r\n  <DT>Webmaster issues</DT>\r\n  <DD>Message to Pollo, DJ Pet, Percy</DD>\r\n  <DT>Evening Plans</DT>\r\n  <DD>Starting at 9pm on Friday, no after dance.  Planning Saturday during the day, should happen for classrooms to be a good break-down and set-up.  Saturday, format is not really a problem, but needs to grow, take corners for perfomance troups, or clubs.  Music going on, but things going on.  Not that heavily MC\'ed.  Upping the money for the night, because the perfomers want to be paid.  Dress-up party, but not necessarily masquerade.  Some theme, TBD.  Maybe tied in to the Theme.  Fetish Prom Night, possibly.  No food inside.  Discount cards for local restaurants.  See also sponsorships.  Possibility of other restaurants, and shuttle bus.  Worried about the $30.  ($25 early purchase.)  Scott to put the Sisters of Perpetual Indulgence in touch with DJ Pet.</DD>\r\n  <DT>Hotel Party</DT>\r\n  <DD>No hallway time, no blocked rooms, no room-blocks, ajoining rooms acceptable, no noise complaints, people in the hallway are the party\'s problem.  We want people to be in _our_ hotel, and we don\'t wish it to be a deterrent.  Find a balance.  Keep it in the rooms.</DD>\r\n  <DT>Outside People</DT>\r\n  <DD>Moving Violations: Coat-Check, Mob: Tag Sale? Imperial Court: Bar night?  Black and Pink: ??</DD>\r\n</DL>','2011-10-05'),(4,'3rd Meeting',2,'<OL>\r\n  <LI> Jerry/Security\r\n  <LI> Sponsorship\r\n  <LI> Volunteers\r\n  <LI> Vendors\r\n  <LI> Hotel\r\n  <LI> Security\r\n  <LI> Programming\r\n  <LI> Program book\r\n  <LI> T-shirts\r\n  <LI> Webmaster issues\r\n  <LI> Evening Plans\r\n  <LI> Name Badges\r\n  <LI> Twitter\r\n  <LI> Fetlife Ads\r\n</OL>','<DL>\r\n  <DT>Flee Meeting/Board Meeting SWITCHED</DT>\r\n  <DT>Jerry/Security</DT>\r\n  <DD>Talked to him, seemed OK with 2 rooms/8 people on for the 1,200 price tag, for 6pm to 6am coverage.</DD>\r\n  <DT>Fleedom Trail</DT>\r\n  <DD>Discussion with Programming, Sunday at NCSF table stop by, scheduled with Programming</DD>\r\n  <DT>Stephen/Sponsorships</DT>\r\n  <DD>Not heard from him.  Call tomorrow, if not heard by Friday, go to second or third pick.</DD>\r\n  <DT>Volunteers</DT>\r\n  <DD>Mark the calendar, enjoy the holiday, then sign up.</DD>\r\n  <DT>Vendors</DT>\r\n  <DD>96 vendors registered, 20 new.  Some problem children.  Some big vendors need some hand-holding.  Phoenix is being active.  Phoenix to give us Amazing contact, or negotiate for us.</DD>\r\n  <DT>Hotel</DT>\r\n  <DD>Hotel is happy.  Definitely have the Restaurant Annex.  Winter Sports, special wristbands.  Negotiations for them.</DD>\r\n  <DT>Security</DT>\r\n  <DD>See the \"Jerry\" section.</DD>\r\n  <DT>Programming</DT>\r\n  <DD>Gave Bendy\'s update.  OK on the compensation for local folks as FFF entrances, Scott has the cards for that.  Nothing more on Morre.</DD>\r\n  <DT>Program book</DT>\r\n  <DD>Allegra contacted, not heard back from yet.  Pull-outs/seperate pages for the grids.  Willow redrawing all the floormaps.  Board bios, 600 characters.  350-400 words for class/bios.  Pictures for the contest sent in.  Need Phoenix artwork by end of year.</DD>\r\n  <DT>T-shirts</DT>\r\n  <DD>At least some for Jerry.  Artwork for them?  Catwoman one?  Need to get more of the grey.  Two types of shirts, FFF, undated.</DD>\r\n  <DT>Webmaster issues<DT>\r\n  <DD>Percy covering, Scott covers mailing lists</DD>\r\n  <DT>Evening Plans</DT>\r\n  <DD>Jim Unavailable, cards to be talked about, deadline in 2 weeks?</DD>\r\n  <DT>Name Badges</DT>\r\n  <DD>Investigate</DD>\r\n  <DT>Twitter</DT>\r\n  <DD>Tweet from Ctan</DD>\r\n  <DT>Fetlife Ads</DT>\r\n  <DD>Suggested for December</DD>\r\n</DL>','2011-11-02'),(5,'3rd Meeting (Class mapping)',5,'This meeting is predominantly focused on class mapping and choosing.','<P>Attending: Percy, Katherine, Kyle, Courtney Jane.</P>\r\n<P>The time was spent mapping the classes to people, and picking the ones, of those people, we were going to pitch to them, as the classes we wanted.  The classes we have are in Zambia as Vetted.  We didn\'t get as far as we wished during the meeting, so we will be picking up again, on 2011-11-08 at 6:30pm.</P>','2011-11-03'),(6,'4th Meeting (Continue Class Mapping)',5,'Continue choosing classes, and begin mapping them to the schedule.','Attending: Em, Katherine, Courtney Jane, Kyle and Percy.<br>\r\nWe worked through more of the entries.  Will be updated with Courtney Jane\'s notes soon.','2011-11-08'),(7,'5th Meeting (more class mapping)',5,'Continuing to get everything nailed down, and in place.','Attending: Kyle, Buddy, Pollo, girlMouse, Percy.<br>\r\nWe had some baubles, being no one from liaison was present, so we muddled through, scheduling where we could.  We need some help from Liaison what the status of the remaining vetted classes are.  None of Sol\'s times, actually match class times, so that might need to be renegotiated, somehow.  Some panels moved to vetted, more to be done, soon.','2011-12-01'),(8,'4th Meeting',2,'<UL>\r\n  <LI> Vendors\r\n  <LI> Vols\r\n  <LI> Hotel\r\n  <LI> Fetlife\r\n  <LI> Fleadom Trail\r\n  <LI> Programming\r\n  <LI> Program Book\r\n  <LI> T-shirts\r\n  <LI> Rooms\r\n  <LI> Next Meeting - T-shirt Pix, Signages, Badges\r\n</UL>','','2011-12-21'),(9,'Wrapup Meeting',5,'<OL>\r\n  <LI> Order food.\r\n  <LI> Group reports\r\n  <LI> Outstanding Efforts recognition\r\n  <LI> Feedback Highlights\r\n  <LI> Lessons Learned\r\n  <LI> Improvements/changes/wishlists for next year\r\n  <LI> New Items (anyone proposing anything for the Agenda)\r\n  <LI> Announcements\r\n  <LI> Wrapup\r\n<OL>','Ordered food\r\nCalled to order at 7:18pm\r\nLiaison report\r\n-Overall really good job\r\n-Coral didn\'t like 9am and 11pm class array\r\n-Consistent request for non 101 level classes\r\n-Wintersong promised to be invited next year\r\n-CJ is thought to be a good potential replacement for Bendy\r\n-Survey and survey announcement modifications to be looked at\r\n-Name tag modifications to be looked at\r\n-Class schedule modifications (spacing and amount) to be looked at\r\nLogistics\r\n-Dedicated AV/projector person\r\n-Precon person for logistics planning\r\n-Shelves for green room?\r\n-Dedicated rooms? Preset rooms?\r\nFood\r\n-Variety was well recieved\r\n-Knowledge of food wasn\'t well distributed\r\n-Good volunteer cookies\r\n-A lot left over food\r\n-Volunteer baking?\r\n-Con slut?\r\nVolunteers\r\n-Need to centralize information (emails, etc.)\r\n-Best year for volunteers yet\r\n-Only two \'never again\' list\r\n-Volunteers separated from presenters in Zambia?\r\n-Streamline programming vs. general volunteer process\r\n-Volunteer room staff process to be adjusted\r\n-Wrist band policy created ahead of time\r\n-Double wrist band orders next year\r\nSpecial mentions\r\n-Stormy\r\n-Jim\r\n-Sparkdog\r\n-Pencildragon\r\n-William\r\n-Kara\r\n-Coral\r\n-P.E.T.E.\r\n-Murphy\r\nFeedback\r\n-Temperature complaints\r\n-Room size complaints\r\n-More advanced classes\r\nLessons learned\r\n-Dedicated runner\r\n-Phone number for green room\r\n-Monthly meetings need to be more explicitly agenda\'d\r\n-Fewer \'everyone comes\' meetings\r\n-More clearly defined roles\r\n-Zambia feedback\r\n-More clearly defined processes\r\n-Zambia check in takes too long; must have better interface with written intermediaries\r\n-Master list of useful reports\r\nImprovements\r\n-Second Jason\r\n-Photo room very successful\r\n-Last block caused presenter friction\r\n-Presidental Suite problems\r\n-Two volunteer hubs need a quick communication channel\r\n-Elevator volunteers?\r\nWrap-up\r\n-Excellent job\r\n-Better than expected\r\n-This year less chaotic and friction\r\n-Programming book really good, a few changes for next year\r\n-Fewer presenters\r\n-More 101\r\n-Less 101\r\n-More panels\r\n-Better promotions next year\r\n-Roles to be better defined for sure\r\n','2012-03-01');
