INSERT INTO `CommentsOnProgramming` VALUES ('1',1,'Michael Sol','Michael Sol : sol4edu@ aol.com : Michael Sol : solR :  :  : '),('1',2,'Kimberly Quin ','Kimberly Quin  : happygirl40@ymail.com : Lauran Star  : lauran@lauranstar.com : www.theexcellencegrp.com : First aid training - Lauran is an American Heart instructor - as well a womens leadership coach - she is also sub LOL - that being said she has taught several first aid classses for the BDSM group I play with - and they ROCK!  She is funny, and very very informative.  She is proffessional - and a rock star.  \r\n\r\nI believe she has another company that focuses on the sexual aspect of women and BDSM... not sure what it is - i know she is also working on a book on the D/s topic ... \r\n\r\nHope this helps : We need first aid training - Dom and subs ... CPR ... ect'),('225',3,'Kyle','Kyle : BostonDSM@gmail.com : MaillerPhong : Don\\\'t know : www.interwovenimages.com : Mailler does really good ropework and seems to have a genuine interest in improving his presenter skills. His class on Decorative Bondage at Shibaricon, if trimmed down to 90 minutes, could be a strong class. : Kat and I think he and nolovelost are really cool so we might be biased.'),('1',4,'Stormy','Stormy : anskiere_stormwarden@yahoo.com : Scott : scott@bigheadstudio.com : bigheadstudio.com : Scott presented this last year and i and my sub both enjoyed the presentation. he is funny has a lot of fun with his class and  just was very good about showing all sides of the violet wand he was presenting : '),('1',5,'Bob Peterson','Bob Peterson : bobp@contracorner.com : Dart : dart@dartsdomain.com : http://dartsdomain.com : A gay, male podcaster who interviews many kinky luminaries. Dart can talk with authority on bondage and power exchange (and podcasting). : I\\\'d find him a strong draw. He\\\'s good at performance demos as well.'),('1',6,'Meggan Sorensen','Meggan Sorensen : hrhsonja@gmail.com : MsSaskia : DaSozz@aol.com : www.pavloviadenver.com : Specifically fire play but really she can present on a number of topics. : '),('1',7,'Parker','Parker : ropeboi@gmail.com : WhipMaster Bob & BootPig : wmb.bootpig@gmail.com : n/a : I saw them present at Dark Odyssey Fusion 2011 and was completely wowed by their expertise, useful information, command of the class, breathtaking chemistry, and intensity.  Additionally, many of the classes they teach are topics and/or perspectives that I have not seen at the Flea since I have been attending for the past few years. : '),('1',8,'Pix','Pix : pixielated24@gmaili.com : Lynk : BDSMBodywork@gmail.com : http://doctorlynk.wordpress.com/presentations/ : I met Lynk at The Floating World last year.  He was part of a presentation that I really enjoyed.  He also took a great deal of time to speak with us after the class, and through both the class and our conversation afterwards it was very apparent how well versed at his specialties he is.  I think a few of his classes would really fit in well at the FFF.  Beyond The Basic Rubdown, Knife Play: From Sensual to Sadistic, and Sadistic Massage are three of his classes that I think people in the community might really enjoy.  I\\\'ve seen him do knife play, and one of his other areas of expertise is anatomy so I think the massage classes would be well taught by him as well.  : '),('1',9,'Pix','Pix : pixielated24@gmaili.com : Capt Gordon : 01captgordon@gmail.com : N/A : I attended Capt Gordon\\\'s Artistic Needle Play class at TFW last year.  He was intelligent, educated, and was a wonderful presenter.  I think he would be a great addition to the FFF.  He presents the following classes: Kinky Wrestling, Rough Housing and Sensual Take-Down,Branding 101, Fire Play 101, Fire Breathing and Performance, Artistic Needle Play, Edgeplay vs. Extreme Play, Hooked(hook pull), Flesh in Flight(hook suspension), Sacred Body Modification as well as a few others.   : '),('1',10,'Pix','Pix : pixielated24@gmaili.com : Angel and Sebastien : sebastienadeyoha@