e hosted Kinky Karaoke at The Floating World this year, with myself as his assistant, and we have already committed to doing so again next year.  In exchange for his work, we were offered two tickets (full admission) to the event, which we gratefully accepted.\r\n \r\nHe has committed to running karaoke twice during Brimstone II in November, on Friday evening as a main social vent from 11-2am, and again on Sunday from 7-9pm as one of the culminating social events of the weekend.\r\n\r\nKaraoke is a wonderful social ice-breaker, for those who enjoy singing and those who are voyeurs.  The possibilities are endless with a  bit of promotion: Dominants \\\'forcing\\\' their submissives to sing, having small prizes donated by vendors (around the $5-$10 range) that encourage the winners to visit and spend more of course <wg>; we have a bin of silly prizes (bubbles, Little toys, etc) for those willing to take a try.\r\n \r\nWe are proposing that Fetish Flea have the same terrific event. Mike can set up a thread on the event page on Fetlife, and can do the same from the main FFF page as well, where those interested can request a song book be sent to them in advance. If they have specific songs they would like to perform and he does not have them, he will usually be able to get them, provided they exist as karaoke tracks. \r\n \r\nAll in all it is a fun event, and we sincerely hope that you will consider taking us on as a special event.  We look forward to working with you over the next several months to ensure that Kinky Karaoke at FFF is a phenominal event.\r\n : '),('100',19,'David Houston','David Houston : three.pears@gmail.com : SwitchMe : three.pears@gmail.com : n/a : The Fine Art of Prostate Massage : Description: The prostate is an often-mysterious part of male anatomy.  It can also be a source of intense pleasure.  As part of the male reproductive system, it is vital to health.  When included as part of the sexual arousal cycle, and as part of the arouse-release cycl