Art of Caning : Description: Ah, the bygone days of yore, when the Headmistress would quickly direct you to bend over and heartily apply a dozen rounds of a good, stiff rattan cane at the mere hint of disobedience. That kind of schoolyard fun may have vanished, but caning is still an exquisite and wonderful art. This workshop will look at canes: the tool, the material, the proper care and feeding, techniques (standard and special) as well as how to slash your toy budget and *still* have fun. Safety first, little ones - we\\\'ll spend time making sure that you don\\\'t overstep your boundaries and keep playing safe.\r\n\r\nClass Level: Any\r\n\r\nClass Format: Hands-on Workshop\r\n\r\nRequirements: None (except enthusiasm)\r\n\r\nObjective: To acquire the essentials of caning. \r\n'),('100',23,'David Houston','David Houston : three.pears@gmail.com : SwitchMe : three.pears@gmail.com : n/a : Breath and Energy : Description: Play can offer a path to a powerful connection.  Our partners-in-play can bring more than a whipping post or power exchange to our encounters - if we are open to it.  We can learn to meet with our minds and our bodies in ways that bring ecstasy to those encounters, opening and expanding the possibilities.  This workshop introduces you to the wonder and power of breath, how we can learn to use that power to build a powerful erotic energy, to deepen an existing connection or to forge a new one.  \r\n\r\nWe will begin with some simple exercises to lay a foundation.  We\\\'ll explore breath as a way to share, build and expand sexual energy, then we\\\'ll put this into practice.  Through a series of short exercises and demonstrations, you will discover that the power of breath and sharing energy can happen while you play, and can be brought into your favorite activities with just a little practice.\r\n\r\nYou are encouraged to bring your curiosity, any partner(s) you have, some favorite pastimes and the tools and toys you favor to practice these pastimes