ny ways.  Why be tied down like that? This workshop is a potpourri of the joys of Queer Sex.  We\\\'ll start with some basics about pronouns and body parts, then we\\\'ll look at how these sometimes self-imposed limits get in the way of having more fun.  There will be a segment on safety (of course), bisexuality, overcoming your fears and avoiding judgements.  Finally, we\\\'ll get down and dirty with a look at many of the toys, techniques and just plain hot ways we can have fun regardless of who we are.\r\n\r\nClass Level: Any\r\n\r\nClass Format: Hands-on Workshop\r\n\r\nRequirements: None (except enthusiasm)\r\n\r\nObjective: To break the usual barriers and boundaries that happen around bodies and gender, and leave participants eager to welcome new partners. \r\n\r\n'),('120',26,'BossBondage','BossBondage : boss@bossbondage.com : BossBondage : boss@bossbondage.com : Unknown : BossBondage has been involved in the BDSM community for the last 13 years. He is the founder and president of The West Coast Assholes an edge players advocacy group that focuses on edge-ucation within the community. He also served His community for two years as the vice president of the Portland leather Alliance. Boss recently received mainstream attention, working as the bondage consultant on the music video for def jam recording artists Electrik Red. As well as appearing on the national news in Canada doing a bondage performance. For 5 Years Boss operated His own professional dungeon The Asylum. Born from his love of hemp bondage rope, He started BossBondage.com in 2002, where He produces his own line of Hemp Bondage rope. Boss has been a body piercer since 1995 and currently operates PlayPiercingKits.com which sells play piercing kits and medical kink accessories. Boss does not get too tied down to titles and just considers Himself to be a bondage artist. In the last several years,through intensive performance of bondage, in particular suspensions, He has developed a unique style. He is self taught. Boss makes his living full time as a BDSM educator and has taught at countless events throughout America as well as Canada and Europe Boss is a proud sponsor of shibaricon 2012 and will be returning for his fifth year in a row as a shibaricon instructor. : '),('100',27,'William Smith','William Smith : anchormen85wds@yahoo.com : William Smith : anchormen85wds@yahoo.com : www.thesocietyct.org : I am suggesting this event because a 10 week class will be starting at the Society in February. We have had a lot of interest and feel it would make a good workshop for the Flea. : Introduction to Western Tantra\r\n\r\nEver saw or read about Tantra? Had any interest, thoughts, or questions? Think you may want to take some classes? If you\\\'re just curious this is the class for you to find out more... \r\n\r\nSome of the Benefits of Western Tantra Practice Can Include:\r\n• Heightened sensations of pleasure during play and sex\r\n• Increased orgasmic Intensity during play or sex.\r\n• Increased Stamina and Performance\r\n• Learned Voluntary Ejaculation (Overcoming Premature Ejaculation for Men)\r\n• Stronger and Harder Erections (Men)\r\n• Increased Vaginal Sensation and Muscular Control (Women)\r\n• Potential for Multiple Orgasms (Men and Women)\r\n• Potential for Full Body Orgasms\r\n• Enhanced Intimacy\r\n• Balanced Giving and Receiving\r\n• Increased Awareness and Acceptance of Sexual Expression\r\n• Increased Awareness and Acceptance of Body\r\n• Deepened Peace and Relaxation\r\n• Experience of the Spiritual Nature of Sexuality\r\n• And much more.\r\n\r\nLarge area open room\r\n\r\nAttendees dress corfortable, gym type clothing.\r\nBring a mat or blanket for the floor.\r\n\r\nMaybe 2 classes:\r\n\r\n1) Western Tantra Q/A Class (2 hours)\r\n2) Western Tantra Workshop (2 hours)\r\n\r\n'),('0',28,'Annonymous','Five stars'),('0',29,'Annonymous',':)'),('0',30,'Annonymous','Loved it! So well organized. It was my first time at this event and I was thoroughly impressed with the scale of it, the hotel staff was so friendly, the NELA board members and volunteers were responsive in a multitude of ways, the classes were varied and the ones I attended were of top quality. Thank you to everyone involved. ~Michelle'),('0',31,'Annonymous','This is the only class I attended that I was not working in and would appreciate more classes and panels like this where various people talk about a subject rather than so many that are one person\'s narrow perspective on a subject.  \r\n\r\n101 classes lend themselves to a single presenter but please try to offer more panels for the older folks next year.  When you have been in the lifestyle for years, as many of us have been, the 101 classes don\'t hold much interest.  Don\'t get me wrong, there should be a certain amount of 101 for newbies - this is, after all, supposed to be an educational as well as vending event and newbies will always need and want the 101 type class but the discussion groups seem more interesting to me as an older individual.\r\n  \r\nI am jumping on the bandwagon here, the 90 minute format might have been easier for prgramming but it is not practical when classes are so varied in the amount of time the subject needs or deserves and only your presenters can tell you what their time constraints should be.\r\n\r\nFinally, let me say that this was a wonderful year at the flea and most everything seemed perfect.  Thank you for all your effort to provide an educational and safe environment for newbies and warm and welcoming one for the more experienced lifestyler.'),('0',32,'Annonymous','\r\n'),('0',33,'Annonymous','Well done FFF, but need different hotel.'),('0',34,'Annonymous','Good times!'),('0',35,'Annonymous','-Wouldn\'t mind more followups on past year\'s programming \r\n-Classes in the hotel rooms fill VERY quick, especially if the room monitor doesn\'t clear the previous class, many just stay and that means only a few people (who might\'ve been waiting in line) can get in. \r\n-Con staples like Closing Ceremonies, Opening Keynote, and con suites would be welcome.  \r\n-Maybe a dinner where you can meet some of the \'kink celebs\' or raise money for charity? The fashion show/drinking and prom really don\'t interest me.\r\n'),('0',36,'Annonymous','Good Gawd, I love the FFF :)'),('0',37,'Annonymous','So much knowledge in one place. It made me want to be more diurnal, able to be in multiple places at once, and take better notes.'),('0',38,'Annonymous','I found that the attendance at the flea has been growing each year to the point that I am being turned away from more classes/panel discussions that I am able to attend.  NELA may wish to consider doing pre-registration for classes, one to be able to accommodate the class size, and two to reduce the amount of blocked/congested common areas.  '),('0',39,'Annonymous','create a pre-registration for the classes so that the room size was more appropriate for the class size'),('0',40,'Annonymous','create a pre-registration for the classes so that the room size was more appropriate for the class size'),('0',41,'Annonymous','The increase in attendance each year makes adjusting how NELA handles the flea to accommodate the changes in operational needs.'),('0',42,'Annonymous','FFF was amazing, I learned so much and enjoyes all the vendors. I will definatly be at the next one. '),('0',43,'Annonymous','I do understand that there is always a struggle to find the right balance when determining the length of time to give presenters, but I feel that this class should have been allotted more time; perhaps NELA might consider structuring the schedule so presentations that require a bit more time can be worked in. Overall, I was as pleased with this year\'s show as i was with last year\'s and I look forward to the next winter flea.'),('0',44,'Annonymous','I had an amazing time at the flea.  I was saddened to see my fellow kinksters doing things like smoking in the stairwells, wearing fetish gear into the food c