INSERT INTO `CommentsOnSessions` VALUES (485,'0',1,'Annonymous','Having a bottom in a slightly different situation would have added a little more diversity (not identifying as slave or 24/7). Tops were very diverse. Whole panel was excellent, thought-provoking, informative, and presented well together'),(215,'0',2,'Annonymous','Probably the best class I have ever been to. TheLauren is a fantastic presenter, and her viewpoints refreshing and amazing'),(121,'0',3,'Annonymous','Funny, informative, awesome. '),(159,'0',4,'Annonymous','Really appreciated Laura\'s teaching style, which is excellent. Her sharing from personal experience from both the Top\'s and bottom\'s perspective was really helpful. I learned a lot and definitely have my eyes opening to new possibilities in the power exchange dynamic as a result of taking this class.'),(158,'0',5,'Annonymous','excellent presenter!! Will look to read more of his writings and hope to be in future classes with Lee. '),(483,'0',6,'Annonymous','I appreciated reformatting of this forum to a round table discussion due to the fewer numbers of attendees then was expected. With the change in format though I struggled a bit with the facilitators/leaders style of managing the group - 2 leaders seemed quite comfortable switching formats to a discussion mode, where as on seemed more comfortable in a didactic format, which was awkward at times. But the content and what participants brought to the discussion was great, and two of the facilitators encouraged discussion and sharing in a way that invited dialogue and sharing. I found it very helpful and will definitely seek further discussions in BDSM & Spirituality. Logistically, I think the class was offered too late in the evening. I was glad that it ended earlier then was originally planned. '),(242,'0',7,'Annonymous','the presenter was fantastic and did an incredible job, so much more than anticipated'),(98,'0',8,'Annonymous','The volunteer class facilitator was dismissive of his duties saying he was only there to check wristbands, didn\'t have surveys, and was openly dismissive of the topics discussed more than once.  '),(121,'0',9,'Annonymous','This was my favorite class out of the 5 I took at the flea this year...funny and informative! Great teachers!'),(242,'0',10,'Annonymous','Teachers technique was unquestionable. However, his ability to teach the class was very disappointing. All over the place, didn\'t stick to his guidelines that he made and handed out, lots of demonstration but not much explanation. Wasn\'t straightforward with his questions to his volunteers, I\'m glad I didn\'t volunteer for anything! Left rather annoyed that evening. Real shame...again, he\'s good at what he does, but his teaching skills weren\'t there.'),(18,'0',11,'Annonymous','This particular panel was very popular and there was not nearly enough room in either the space given it last year as well as the space provided this year.  Possibly the Presidential suite would have been ample in size for a classroom setting with chairs lined up but being more of a discussion group, they apparently like the circle of chairs idea much better (as do I for this type of group).  The presenter was informative and knowledgable on her subject and very entertaining in her comments.  She would have been wonderful on her own, but she provided a backup panel of ladies that voiced a wide range of opinions on any of the subjects addressed.  Bring her back every year but give her at least a 2 hour slot!'),(139,'0',12,'Annonymous','Hi folks, I was the Intro person in the class. I have no interest in violet wands.. hate the darn things but I have to say, Ann is an amazing presenter. Her class was standing room only (518 was a bad room to have this class in, would have been better in Naragasett C. She interacted so well, explained so plainly that everyone could understand. She had someone attending who was petrified of the wand and who was there as her partner wanted to help her be more comfortable. Ann was great about not just pressing forward and \"making\" her like it. Its good to see a presenter who is knowledgable, fun and open. \r\n\r\nHer time slot was great, so many folks went off after to find a wand to buy(no pressure from the presenter, she actually told them other places they could purchase). The room as I said was awful, there was no table available for her stuff and simply no room. \r\n\r\nIf possible, this is a class that could and probably should be run twice during the flea. The timeslot was great so people could shop but so many people were not even at the Flea yet. '),(235,'0',13,'Annonymous','As the intro person for this class who had no interest or experience in this venue, I still found it interesting. It was not a class that needed 90 mins in fact it ended before an hour was up. It was sparingly attended but no one got up and left and those who were there got a great history lesson. '),(207,'0',14,'Annonymous','While Jenn is a really nice person this class just bombed. I think there were a number of reasons for this.\n1. the room was too big for a more intimate conversational class like this.\n2. This class started out with about 42 folks in it, she lost more than half the class before it ended. This does not take into account the number of folks who came in in and left after sitting for a few minutes. \n3. It would be good if the info she began to get into at the end was what she started with. At the tail end of her presentation she began to catch the attention of the folks still left. \n4. If this class is going to be a big lecture type class, it would be much better served by someone more dynamic and able to catch and keep a wide variety of peoples interest.\n5. If the same presenter is to do this again, I would actually recommend more of a small answer and question period. This would help the presenter to get to the subject matter quickly that people are interested in.'),(506,'0',15,'Annonymous','Not going to beat a dead horse and tell you what an awesome presenter Bendy is! \r\n\r\n\r\n1. this class needs to be in a different class room as well. While Blackstone was bigger then say 518 but still not big enough. This room was also standing room only and certainly was a fire hazard with all lanes of egress blocked by people. \r\n\r\n'),(274,'0',16,'Annonymous','These 2 are great! Dr Bob and Jen are so fun. They kept the information coming for the entire 90 mins. They were educational, fun and had the ability to get information across in an understandable way to a wide spectrum of people. Some thoughts.. ( i was the intro person for this class)\r\n\r\n1. Dr. Bob did not want the mic (for the obvious reason that he needed his hands free) and I think he believed he was easily audible. He was not, this I think is true of most presenters who presenting in the bigger rooms. These are large rooms with bad acoustics. When a presenter starts a class and says, CAN EVERYONE HEAR ME. most of the time the audience can, however, over the course of a presention, more people enter and sit further back and the presenter rarely keeps their tone at the same level as when they asked the question. \r\n\r\n2. this class needed to be in the large size room it was and yet because of the subject matter, it was difficult to arrange the room in any way that worked best for viewing '),(18,'0',17,'Annonymous','Try to have a Fem DOM PANEL Not limited to just Society dominant women.'),(18,'0',18,'Annonymous','It sucked'),(274,'0',19,'Annonymous','I went to Dr. Rubel\'s \"Playing with the Pussy\" demo with some idea of what to expect as I went to their session last year as well and enjoyed it. I did enjoy this year\'s class as well--in particular, the overview of female anatomy was really excellent, and I also really appreciated hearing from Jen about her experiences, which was fascinating. There was also an audience member who seemed to have been invited who was an ob-gyn and this was really helpful for answering questions from the audience. I give all that a thumbs-up. \r\n\r\nHowever, there were a couple things that I found disturbing about this year\'s class. For one, there was some very heavy play which clearly caused some audience members discomfort, including punching--not just on her pussy. That might have been okay, but I certainly did not expect it and there was no disclaimer that there might be content that might squick some. As another example, they used an electro-stim device, which I am familiar with but was not introduced or explained (my friend had to ask me how it worked). \r\n\r\nThe other item that I find really unacceptable was a fairly blatant dismissal of safer sex concerns. While putting on gloves, Dr. Bob said something very clearly about how he would use them \"to be good\" since they were on stage--with the implication that it isn\'t necessary otherwise. At another point, he seemed to be concerned that she was bleeding, saying \"I can\'t figure out where it\'s coming from\"--at that point he tasted some of her fluids. While it was clear that they were a fluid-bonded couple, I don\'t think this sets a good example on the part of the presenter. As a young person, I hope to see role models in those members of the community that assume leadership roles, including those teaching, and this was really a failure in my view. '),(221,'0',20,'Annonymous','Midori is extremely charismatic, clearly knows her shit, and presents the material in a way that\'s both informative and highly entertaining.'),(508,'0',21,'Annonymous','While I fully support the ideas discussed here, I thought the presentation was pretty boring. The presenters were nice people but really couldn\'t keep my attention for very long. It felt more like a presentation of \"the story of our relationship\" and not so much a presentation/discussion/interaction/or even debate about how the lifestyle can be successful to people in general.'),(94,'0',22,'Annonymous','VERY nice class, though could have used more practical demonstration. \r\nUnfortunately, popular enough there were people sitting in hte \'aisles\' and a big crowd by the door blocking it. '),(136,'0',23,'Annonymous','Nice and casual, but MUCH too large a space (in contrast to other experiences at the Flea)'),(18,'0',24,'Annonymous','We were a little cramped in the assigned room but we made it work.  As a FemDomme, I enjoy this time to get to know new people and to offer my support to them and the community in general.  '),(196,'0',25,'Annonymous','I was unable to attend the class because it was offered in a room far to small for the amount of interest.  '),(234,'0',26,'Annonymous','The interactive nature of this class was very enjoyable and inviting.  But the amount of people attending the class was too small for the room provided.'),(513,'0',27,'Annonymous','The in person demo on both genders was very informative and helpful.  I was a first time sounder and it was much more helpful and informative to see the demo than it was to just read about it.'),(234,'0',28,'Annonymous','The interactive nature of this class was very enjoyable and inviting.  But the amount of people attending the class was too small for the room provided.'),(221,'0',29,'Annonymous','I was unable to attend this class because the line to get in was too long far too early to allow entry.  Please implement a preregistration system so that those who want to get in can get in and still enjoy the rest of the flea whether that be socializing, shopping the vendors, or doing multiple classes(waiting around for a minimum of 1/2 hour prior to class start time when the previous class doesn\'t let out until 15 minutes before the next class starts makes doing back to back classes impossible).'),(98,'0',30,'Annonymous','This class was awesome! Although we could have used a slightly bigger room. '),(98,'0',31,'Annonymous','The class was good.  The teacher was well versed in the subject matter.  The problem I had was that one person who had been in 