INSERT INTO `EmailQueue` VALUES (13,'Programming <fff38-programming@nelaonline.org>','percy@nelaonline.org','','Programming: 1st meeting','--=-c9gIYDFy6dDOSlQHox6nnContent-Type: text/html; charset=\"utf-8\"nContent-Transfer-Encoding: 7bitnn<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0 TRANSITIONAL//EN\">n<HTML>n<HEAD>n  <META HTTP-EQUIV=\"Content-Type\" CONTENT=\"text/html; CHARSET=UTF-8\\\">n  <META NAME=\"GENERATOR\" CONTENT=\"GtkHTML/3.30.3\">n</HEAD>n<BODY>n<OL>rn  <LI> Changes from last yearrn  <LI> Teams and their captainsrn  <LI> Scheduling forecastsrn  <LI> Budgetrn  <LI> Task Listrn  <LI> Zambia Familiarizationrn</OL>n<hr>n<OL>rn  <LI> Changes from last yearrn  <UL>rn    <LI> Essence not changing, some details willrn    <LI> Security Detail all night (not us)rn    <LI> Each lounge running one day (4 lounges, 2 days)rn    <UL>rn      <LI> Maureen (hopeful) - poniesrn      <LI> Domino and Dee (confirmed verbally) - Whip Loungern      <LI> Jay (Percy\\\'s got to talk to Matthew Jay confirmed verbally) - Bondage Loungern      <LI> Jay (confirmed verbally) - Photo gallery/loungern    </UL>rn    <LI> New tracks (Remember this is an intro event)rn  </UL>rn  <LI> Teams and their captainsrn  <UL>rn    <LI> Div Head - Percy Deputy Kylern    <LI> Programming Volunteer Wrangler - Mike Deputy girlMousern    <LI> Speaker Liaison - Bendy Deputy Courtney, Sweet Wisteriarn    <LI> Green Room Food - Kat Deputy girlMousern             Snack food, not meals, crock-pot food (chowder, stew, potroast) big candy bowlrn     <LI> Logistics - Williamrn     <LI> Publications - Mike and Em (electronic and paper)rn     <LI> Admin - Sweet Wisteriarn     <LI> Promotions - Naughty Emrn     <LI> Recruiting - Buddy Deputy Katrn     <LI> Lounge Liaison - Jay Deputy Torirn  </UL>rn  <LI> Scheduling forecastsrn  <UL>rn    <LI> End of October - Out of Town Presentersrn    <UL>rn      <LI> Bendy needs to know of anyone missing by 9/8rn      <LI> BostonDSM, Bendy and Percy work on this over MsCrn      <LI> Presentation of who/budget, etc to date (separate spreadsheet)rn      <UL>rn         <LI> Room Cost ($157 + taxes and fees, like last year)rn         <LI> Travelers Honerariarn         <LI> Travel costs (RI/MA/NH/VT/ME/CT/NY/further afield)rn         <LI> 1/2 Room Night per class is the compensationrn         <LI> Panels are considered \\\"Volunteer Time\\\" and count toward volunteer awards, such as admission, membership, etc.rn      </UL>rn    </UL>rn    <LI> End of November - In Town Presentersrn    <LI> End of December - Schedule locked downrn    <LI> Mid January - Panelists setrn    <LI> January Meeting - At Con Volunteers trainedrn    <LI> End of February - Feedback and Thank yousrn  </UL>rn  <LI> Task Listrn  <UL>rn    <LI> Should be utilized more this time around (wasn\\\'t started until just before con-time last time around)rn    <LI> <A HREF=\\\"genreport.php?reportname=tasklistdisplay\\\">Task List Report</A>rn  </UL>rn  <LI> Zambia Familiarizationrn</OL>n</BODY>n</HTML>nn--=-c9gIYDFy6dDOSlQHox6n--n',1,'2011-10-14 14:48:51');
