INSERT INTO `EmailTo` VALUES (1,'Bendy and Percy for testing',1,'SELECT CD.badgeid, CD.firstname, CD.lastname, CD.email, P.pubsname, CD.badgename FROM CongoDump CD JOIN Participants P USING (badgeid) where P.badgeid in (\'120\',\'123\') ORDER BY badgeid;'),(2,'All Participants',2,'SELECT\r\n            CD.badgeid, CD.firstname, CD.lastname, CD.email, P.pubsname, CD.badgename\r\n    from\r\n            CongoDump CD join\r\n            Participants P using (badgeid) join\r\n            UserHasPermissionRole UHPR using (badgeid)\r\n    where\r\n            UHPR.permroleid=3'),(3,'Participants who are attending',3,'SELECT CD.badgeid, CD.firstname, CD.lastname, CD.email, P.pubsname, CD.badgename\r\nfrom CongoDump CD, Participants P , UserHasPermissionRole UHPR\r\nwhere CD.badgeid=P.badgeid and CD.badgeid=UHPR.badgeid and UHPR.permroleid=3\r\nand P.interested=1'),(4,'Attending participants willing to read own work',4,'SELECT\r\n        CD.badgeid,\r\n        CD.firstname,\r\n        CD.lastname,\r\n        CD.email,\r\n        P.pubsname,\r\n        CD.badgename\r\n    from\r\n        CongoDump CD\r\n            join\r\n        Participants P\r\n            using (badgeid)\r\n            join\r\n        UserHasPermissionRole UHPR\r\n            using (badgeid)\r\n            join\r\n        ParticipantHasRole\r\n            using (badgeid)\r\n    where\r\n        UHPR.permroleid=3 and\r\n        P.interested=1 and\r\n        roleid = 2\r\n    order by lastname;'),(5,'Participants who participated in programming',5,'SELECT CD.badgeid, CD.firstname, CD.lastname, CD.email, P.pubsname, CD.badgename,\r\n    P.interested\r\n  FROM CongoDump CD inner join Participants P on CD.badgeid=P.badgeid\r\n    and CD.email is not null and P.badgeid in\r\n (select distinct badgeid FROM ParticipantOnSession POS inner join Sessions S\r\n    on POS.sessionid = S.sessionid and S.statusid=3 and S.divisionid=2);'),(6,'Attending participants willing to do workshop',6,'SELECT DISTINCT\r\n        CD.badgeid,\r\n        CD.firstname,\r\n        CD.lastname,\r\n        CD.email,\r\n        P.pubsname,\r\n        CD.badgename\r\n    FROM\r\n        CongoDump CD\r\n            join\r\n        (select badgeid FROM ParticipantHasRole where roleid = 6\r\n             union\r\n             select badgeid FROM ParticipantInterests where yespanels!=\"\") WP\r\n            using (badgeid)\r\n            join\r\n        Participants P\r\n            using (badgeid)\r\n            join\r\n        UserHasPermissionRole UHPR\r\n            using (badgeid)\r\n    where\r\n        P.interested=1 and\r\n        UHPR.permroleid=3\r\n    order by lastname;'),(7,'Have not logged in or responded to \"interested\" query',7,'SELECT CD.badgeid, CD.firstname, CD.lastname, CD.email, P.pubsname, CD.badgename FROM CongoDump CD JOIN Participants P USING (badgeid) JOIN UserHasPermissionRole UHPR USING (badgeid) WHERE UHPR.permroleid=3 AND P.interested IS NULL ORDER BY IFNULL(CD.lastname,\'ZZZZZ\');'),(8,'Participants, in programming, who are not also volunteering',8,'SELECT CD.badgeid, CD.firstname, CD.lastname, CD.email, P.pubsname, CD.badgename, P.interested   from CongoDump CD inner join Participants P on CD.badgeid=P.badgeid and CD.email is not null and P.badgeid in (select distinct badgeid from ParticipantOnSession POS inner join Sessions S on POS.sessionid = S.sessionid and S.statusid=3 and S.divisionid=2) and P.badgeid in (select distinct badgeid from UserHasPermissionRole where permroleid=3) and P.badgeid not in (select distinct badgeid from UserHasPermissionRole where permroleid=5);'),(9,'Volunteers, in programming, who are not also participants',9,'SELECT CD.badgeid, CD.firstname, CD.lastname, CD.email, P.pubsname, CD.badgename, P.interested   from CongoDump CD inner join Participants P on CD.badgeid=P.badgeid and CD.email is not null and P.badgeid in (select distinct badgeid from ParticipantOnSession POS inner join Sessions S on POS.sessionid = S.sessionid and S.statusid=3 and S.divisionid=2) and P.badgeid in (select distinct badgeid from UserHasPermissionRole where permroleid=5) and P.badgeid not in (select distinct badgeid from UserHasPermissionRole where permroleid=3);'),(10,'Participants, in programming, who _are_ also volunteering',10,'SELECT CD.badgeid, CD.firstname, CD.lastname, CD.email, P.pubsname, CD.badgename, P.interested   from CongoDump CD inner join Participants P on CD.badgeid=P.badgeid and CD.email is not null and P.badgeid in (select distinct badgeid from ParticipantOnSession POS inner join Sessions S on POS.sessionid = S.sessionid and S.statusid=3 and S.divisionid=2) and P.badgeid in (select distinct badgeid from UserHasPermissionRole where permroleid=5) and P.badgeid in (select distinct badgeid from UserHasPermissionRole where permroleid=3);'),(11,'Programming',11,'SELECT concat(\"100\") AS badgeid, concat(\"FFF-38\") AS firstname, concat(\"Programming\") AS lastname, concat(\"fff38-programming@nelaonline.org\") AS email, concat(\"FFF-38 Programming\") AS pubsname, concat(\"FFF-38 Programming\") AS badgename;'),(12,'Staff',12,'SELECT concat(\"100\") AS badgeid, concat(\"FFF-38\") AS firstname, concat(\"Staff\") AS lastname, concat(\"fff38-staff@nelaonline.org\") AS email, concat(\"FFF-38 Staff\") AS pubsname, concat(\"FFF-38 Staff\") AS badgename;');
/*!40000 ALTER TABLE `EmailTo` ENABLE KEYS */;
UNLOCK TABLES;

