INSERT INTO `ParticipantAvailability` VALUES ('130',5,'','',0),('140',5,'Masquerade ball on Saturday night. ','',0),('141',0,'','I\'ll also be managing my booth for the weekend',0),('144',0,'As I cannot afford to stay at the hotel and will be commuting from western MA, I would prefer to be scheduled for Saturday, and ideally not first thing in the morning. If you\'d like to put me on any additional panels for spirituality, power exchange, or g','',0),('198',0,'I\'m doing some hours in vending/fashion show so I need to coordinate with them','Taking the train so Friday is an approximate time. Hopefully it won\'t be to much later',0),('208',0,'','',0),('209',1,'','',0),('213',0,'Taki\'s Poly Finances Class, or Midori\'s Erotic Humillation and Aural Sex Classes, or the Chocolate Fetish Class.  I would LOVE to be the introduction volunteer in the room for all of these classes (especially Taki\'s since I am owned by him). ','',0),('217',0,'* at least 1 item by David Wraith, I would like to attend at least 1 of his classes.','The above assumes the following megabus schedule:\r\ndepart NYC Fri 4p, arrive Providence, RI 8p\r\ndepart Providence Sun 3:30p, arrive NYC 7pm\r\n\r\nHowever, megabus will not allow us to buy tickets for another 4-6 weeks.\r\n\r\nI have a doctor\'s appointment until ',0),('218',0,'','',0),('223',3,'','',0),('231',2,'','I will be trying to help with the BTNG table at the flea as well. I\'m trying to only volunteer for a max of 4 hours as I want to be able to do other things at the flea.',0),('234',4,'Yoga for Kinksters, Friday Night Party and the Kinky Prom. ','I would prefer to work classes before lunch and have the rest of the day to enjoy the Flea. I can arrive early on Friday if you need help setting up the Green Room.  And NO medical play classes or you might have a class on what to do with a passed out Mou',0),('238',0,'any Midori class or the FemDom discussion','none',0),('250',5,'','',0),('275',0,'','',0),('276',3,'','Schedule me before 10am at your peril. I can only work before 5pm on Friday if I have a hotel room on Thursday or past 2pm on Sunday if I have a hotel room Sunday night.',0),('291',2,'','Please have a (class) break between the classes, and the preference is not the first class of the day, if noon needs to be breached.',0),('292',5,'','Nope!',0),('297',4,'I\'ve tried to indicate availability around the classes and parties I\'d like to attend, so I guess the right way to put it is that I\'ve made myself unavailable during the times that I know I will want to be in a particular class. Otherwise I hope to have s','',0),('354',2,'','No heavy lifting due to chronic back pain.',0),('357',5,'I\'m demo-bottoming for Midori\'s Military Interrogation class.','',0),('358',5,'Midori','I may be able to make Friday but I feel safer with ',0),('359',3,'the Fuck Dogma and Dark Role Play classes','I would prefer to work just Friday, if possible. ',0),('360',5,'','',0),('364',0,'','I\'d love to volunteer for the Mono/Poly panel, Discovering Your Inner Sadist, or TwoPlay, but I will do whatever I\'m assigned. :)',0),('366',5,'','Not a constraint, but would love to introduce Danny, and don\'t mind being away from the party at 11:30 pm on Saturday.',0),('367',3,'Arrival at the flea should be 6pm Friday. I can volunteer Friday evening. I wish to take Bendy\'s yoga class, and three others: Building your Contract, Dominant as Leader and Liminality of Rope. Not Avail Sunday','I would like to volunteer simultaneously with Paul/the_knife\'s_edge/ ID # 368. We needn\'t be on the same duties, but we want to be scheduled for volunteering at the same time frames. Our preference is to volunteer together if possible however. No heavy li',0),('368',3,'I want to take four classes on Saturday. Bendy\'s yoga class, Building your contract, Dominant as Leader and Liminality of Rope. Any other times before or after these are cool to Schedule me. I would prefer my volunteer time coincide with Sweetness/Yvonne/','I can do moderate lifting. ',0),('369',5,'None - if I need to be a little earlier than the times I put that is fine','I picked some sessions I was hoping to work off the programming grid:\r\nFri 8pm Scene Survival for New Players\r\nFri 9:45 Tying Men\r\nSat 1pm So you like it rough?\r\nSat 2:45pm Erotic Humiliation Play\r\nSun 11:45am Getting Good Head\r\nSun 1:45pm Lazy Top\'s Guid',0),('370',3,'','',0),('371',4,'Friday night I will be doing the furniture for the Jaded party, so I will probably have to do the setup from say 5-8 then the breakdown from 2-dawn! I should be available for a shift after 8 if needed. ','',0),('372',4,'','',0),('376',4,'P.E.T.E.\'s classes (demo bottoming)','I\'m not the best at heavy lifting. I don\'t know if this is important or not. But I am good at being adorable, friendly, and flirty :)',0),('377',2,'','',0),('378',0,'I put my availability on Friday until 7:30pm because I want to attend Graydancer\'s \'TwoPlay:The Art of Making Out\' at 8pm so if my \'shift\' ended with introducing or doing something with that presentation, I could volunteer until 8pm or so.','I had originally intended to volunteer for ID checking because I can\'t really stand for long periods of time (like wristbanding last year) or do too much in the way of physical work.',0),('379',2,'','Power | Play: I need to be in attendance if at all possible, but would be happy to volunteer at that session :-)\r\n\r\nLooking for a total of 4 hours, please.',0),('386',0,'Cameryn Moore\'s performance (Power Play) unless I am scheduled to volunteer at the performance.','',0),('387',2,'NaughtyEm\'s Elemental One Hand Clap— Impact— Sat 2:45 PM— 1hr 30min— 518','',0),('388',2,'','',0),('389',5,'','',0),('390',0,'','',0),('391',2,'Saturday (all day)\r\nFriday 7:30pm-12midnight\r\nSunday 10am-11:30am','I much prefer load in or load out.  (I\'m a professional :) stage hand that is...)',0),('392',1,'','',0),('397',5,'','',0),('398',0,'','Please make me Rabbit Intro ',0),('640',5,'','',0);
