INSERT INTO `ParticipantInterests` VALUES ('130','','','','',''),('209','Photography for Every Body (with Jawn): Some people can\'t help but look great in pictures. For those of us who don\'t, there are some simple tips and tricks you can use to make yourself look fantastic! In this workshop, we will explore how to pose to accentuate your best features, look at some psychology behind \"masculine\" and \"feminine\" poses, and go through the basics of lighting and model releases. This workshop is for models and photographers alike, and will be interactive. Bring your cameras!\r\n\r\nNegotiating for Submissives: When entering into any kind of relationship with another person, a negotiation occurs. We agree on what names to use, what pronouns we prefer, how close to get, where we can be touched, and so on. But how much of these negotiations are for what we want vs. what we need? How much thought have you given to what your basic needs are, and how you get these needs met?   This class will use Maslow’s Hierarchy of Needs as a model to help you determine what your basic needs are as a person, and which needs can and can’t be compromised. We’ll also discuss what might happen if some needs aren’t met, and how you can compensate for that.\r\n\r\nI\'m also working on a workshop for coming out to your family...and having them come out to you too, which we\'ll be presenting at TBC as well. Let me know if you\'d be interested in that one, and I can see about tailoring it to the Flea crowd.','','','',''),('217','Sacred Sex, Sex Magic, Personal Authenticity, Faith and Kink, Surviving Events are things I\'d love to see panels on/be on panels for.','','Graydancer, Mollena, Raven Kaldera, Aiden Fyre, David Wraith','Dov',''),('223','Pedular Enthusiasm:  The Universal and Sensual Foot Experience\r\n\r\nTickle Play\r\n\r\nTickling BOF?\r\nFoot Fetish BOF?','','FireHorseTantrika','',''),('231','','','Trialsinner, Solipsistic, Eponine, Bendy, Percy, RiggerJay, DrSlashBlight, etc.','tattooedsailor','I enjoy working on panels where we talk about issues of communication. I\'m generally interesting in things dealing with helping newer people enter the scene (like the panel on BDSM 101 last year) or helping out on panels that involve general topics of communication (etiquette, social awareness, social dynamics, how to get invited to a play party or navigate a munch, etc.). I\'m also interested in issues of consent, how to be dominant without having to be a domly mcdomster, etc. ');
/*!40000 ALTER TABLE `ParticipantInterests` ENABLE KEYS */;
