INSERT INTO `Sessions` VALUES (1,7,2,2,2,1,'','Canine Role Play','','','For the canine in all of us and those who love them. A playtime/romp for the puppies, pups, dogs, wolves, etc. and a presentation/class for those interested in owning, training, and learning more about the canine side of the human persona.','','01:30:00',NULL,1,0,4,'','',1,'',0,1,'2011-11-02 14:32:47'),(2,5,2,2,2,1,'','Fire Play','','','I am sure I am not the only one who would like to see a class on fire play or several: fire play safety, constructing your equipment, basic fire play and advanced fire play.\r\n','','01:30:00',NULL,1,0,4,'Dr. Bob Rubel','',1,'I had the honor and pride of meeting Dr. Robert J. Rubel, PhD, who wrote the book \"Flames of Passion Handbook for Erotic Fire Play\" at FFF #36, and purchased a copy, which he autographed for me.  We spent about 30 minutes talking and he indicated to me that he would love to a series of classes starting with the basics and going on into advanced stuff.  I found him so facinating that I added (with his permission) him to my friends list.\r\n--\r\nUnfortunately, Fireplay (with blood play) is one of the things we are forbidden by hotel contract.',0,1,'2011-11-02 14:33:49'),(3,9,2,2,2,1,'','Toy Cleaning and Preservation','','','Many of the items we have in our toybags are shared between partners and are fairly expensive. How do we clean/sterilize toys without damaging them? What is the best way to preserve leather toys to get the most life out of them [singletails,floggers,cuffs or straps]? Insertables, Ball gags too.','','01:30:00',NULL,1,0,3,'','',1,'',0,1,'2011-11-02 14:33:49'),(4,12,1,2,2,1,'','Formal Service','','','This could include formal tea service, traditional D/s rituals and codes of behavior.  These traditions seem to be falling by the wayside as more and more people join our ranks and I believe it will be sad if these traditions from our forebears are totally lost.','','01:30:00',NULL,1,0,3,'','',1,'I would also like to see Mistress Midori return - I am not certain what prevented her presence at this flea but would hope that it can be resolved for next year.\r\nI think all classes at the fair could be greatly improved with portable microphones for the presenters.  I had difficulty hearing much of what was said especially in the classes that had participation as well as lecture components.',0,1,'2011-12-14 00:56:04'),(5,12,1,2,2,1,'','What to Do When Things Go Wrong','','','There are many problems that arise in a D/s relationship - not only physical, such as blunders in play, but emotional as well.  Correcting the physical blunders is probably the simpler fix, as it is mainly common sense, but the emotional blunders can have lasting effects on both parties.  Maybe suggestions such as contractual agreements and or lessons in complete honesty among the memebers of the relationship could benefit experienced players as well as newbies.\r\nMany of us have lost the Dominant/Submissive roles and need reminding of just how many ways there are to demonstrate these roles and make your dynamic work for you. ','','01:30:00',NULL,1,0,3,'','',1,'',0,1,'2011-12-14 00:56:40'),(6,14,2,2,2,1,'','Ecstatic Breath Ritual & Workshop','','','Breath is primal.  It is the first thing we did upon entering this world and it will be one of the only constants we will know until we draw our last breath upon leaving it.\r\n\r\nThe use of breath to attain altered states of consciousness has been practiced for centuries. It can also be used to manage pain, shift the body\'s physical and emotional state and connect you energetically to other human beings.\r\n\r\nIn this workshop we will explore conscious breathing techniques that can be used within the context of BDSM scenes and other forms of love making.  Some of these techniques are designed to help us connect more deeply to our own core, while also allowing for a deep connection with others and enjoying amazing shared experiences including \"Breath Orgasms\".\r\n\r\nPlease note that this class is about bringing your consciousness to breath and voluntarily altering your own breathing patterns to achieve ecstatic effects.  It has nothing to do with \"Breath Play\" which is an entirely different topic. \r\n','','01:30:00',NULL,1,0,9,'Suzanne SxySadist','',1,'I realize your classes are generally programmed at 75 minutes.  90 mins for this topic is very tight - 2 hrs prefered, but we can discuss this further should you be interested.\r\nIncludes a 2 page handout.\r\nThis is a \"No Late Admittance\" type class and should be a carpeted \"warm\" space.\r\n',0,1,'2011-11-02 14:33:49'),(7,14,2,2,2,1,'','\"Learning to Fly\" - Ecstatic Percussion Workshop','','','What makes for a truly great percussion play scene? Is it the implements involved (a cane, floggers, paddles, fists), the dynamic between the players (Master / slave, Dominant / submissive, top / bottom) the intention of the scene or something more?\r\n\r\n   As a switch, I used to occasionally struggle to endure through the pain of heavy corporal in hopes that it would eventually \"get better\" or the top would get tired and move on to something I found more enjoyable. Then I discovered how the use of ecstatic breath work could help me stay more grounded, relaxed and connected to my partner, and thereby help me to transform and eroticize strong sensation into something not just to be endured but relished and enjoyed. Suddenly we were embarking onto some of the most amazingly connected and endorphin fueled journeys I could have ever imagined. I finally learned to fly on canes and I owe it all to learning how to breathe with my partner.\r\n\r\n  In this class we will now put to use the Ecstatic Breathing techniques we learned earlier to practice in a practical workshop setting. Tops will be encouraged to coach their bottoms to breathe more fully and will learn to become attuned to timing our strokes with the breath and vice verse. This class is not about basic percussion play skills and it will be assumed that the participants are already familiar with the basics of doing percussion play. Bring your favorite implements and a willing partner if you have one, but singles are welcome as well and best efforts will be made to get you some practice time.\r\n\r\n','','01:30:00',NULL,1,0,12,'Suzanne SxySadist','',1,'This class also makes a great \"second round\" to the Ecstatic Breath class I\'ve also offered.  After learning how to  breath through pain and use your breath the connect with a partner, this calls allows you to apply it in a hands-on BDSM workshop environment.\r\n\r\n',0,1,'2011-11-02 14:33:49'),(8,5,2,2,2,1,'','Kink and Disability: How to Play with Someone Who is Disabled','','','A class to talk about how to play with someone who has a disability. ','','01:30:00',NULL,1,0,3,'Mistress Aeval','',1,'I have noticed there isn\'t a class on how you play with someone that has a disability of some sort! i would love to teach or discuss the topic so it can be more aware in our community. I know we are a small group but in reality, you never know who you may meet and play with',0,1,'2011-11-02 14:33:49'),(9,7,2,2,2,1,'','Costume Play','','','A class on general costume play, how to make the most of your costumes, and picking pieces for cost and effectiveness.  The discussion of accessories, props and other non-costume additions will also be included.  Various subjects will be touched on: military, prisoner/abduction, animal play, etc.','','01:30:00',NULL,1,0,4,'Amy Hanson (artisan@misc-etcetera.com)','',1,'I can also teach a class on an specific genres (i.e. steampunk, military), time period (i.e. medieval, revolutionary war), culture or country (i.e. Japan) or a combination.',0,1,'2011-11-02 14:33:49'),(10,11,2,2,2,1,'','Mendhi: The art of Henna','','','This is a hands on class.  The attendees will each get a small tube of prepared henna paste to practice with.  We will discuss the traditions of Mendhi, when and how it was used, and then everyone will get to decorate themselves or a friend.','','01:30:00',NULL,1,0,4,'Amy Hanson (artisan@misc-etcetera.com)','',1,'Some room to move around is best, so everyone can be comfortable as they work.  I need some kind of compensation (for the cost of the supplies): part or all of my vending booth is fine or we can do a $2 a head option.  Either way I need to have a cap on the class (my defined or yours, I just need to know what it is)',0,1,'2011-11-02 14:27:07'),(11,10,2,2,2,1,'','Rope Creation','','','We will discuss how to create various types of rope (spun, braided, etc.) including a square cross section braid.  We will discuss the advantages of different creation styles and materials including strength, clean-ability, etc.','','01:30:00',NULL,1,0,4,'Amy Hanson (artisan@misc-etcetera.com)','',1,'',0,1,'2011-11-02 14:27:25'),(12,11,2,2,2,1,'','Care and Feeding of Fetish Clothing','','','This is a class on the methods of caring for various fabrics, concentrating on those most popular within the scene.  We will also discuss things to look for (and look out for) when shopping for fetish clothing.','','01:30:00',NULL,1,0,4,'Amy Hanson (artisan@misc-etcetera.com)','',1,'',0,1,'2011-11-02 14:26:36'),(13,9,2,2,2,1,'','Impact Play','','','Impact play class will be a show-and-tell event, with an ongoing discussion about safe play, as well as brief demonstrations of many different impact toys.  We will cover where to hit, as well as where NOT to hit someone and the reasons why certain areas should be approached with caution.','','01:30:00',NULL,1,0,3,'Switcher','',1,'Bio - Switcher has been around since before the invention of dirt.  Rumor has it that he is the culprit that actually invented it, but I digress.  He has hosted a munch in the Greater Boston area for several years, as well as vending at the New England Fetish Fair Fleamarket.\r\n',0,1,'2011-11-02 14:33:49'),(14,14,1,2,2,1,'','Religion and Kink','','','Are religion and kink compatible? Not just religions accepting kink, but kinky people being accepting of religion','','01:30:00',NULL,1,0,4,'','',1,'',0,0,'2011-10-27 02:24:20'),(15,9,2,2,2,1,'','Pressure Points','','Knowledge of pressure point displacement originated from ancient Chinese martial arts training. Pressure points are activated by pressing specific body parts to gain physical control without brute strength. This is a part-lecture / part hands-on workshop which will cover the anatomy, technique, safety, and after-care of applying pressure to the most sensitive internal and external points on the body. ','Knowledge of pressure point displacement originated from ancient Chinese martial arts training. This skill continues to be taught today for use to gain anatomical advantage in the martial arena. Pressure points are activated by pressing specific body parts to gain physical control. Subjective response to pressure points may or may not illicit pain depending on the person’s resistance. This method of control can be used effortlessly on a person without using brute strength.\r\n\r\nWant to make your submissive fall to their knees at your feet with very little effort? Want to take them down without breaking a sweat? Then this workshop is for YOU!\r\n\r\nIn this class we will show you how to turn your submissive\'s own body against them with a little knowledge and very little effort. This is a part-lecture / part hands-on workshop which will cover the anatomy, technique, safety, and after-care of applying pressure to the most sensitive internal and external points on the body. ','','01:30:00',74,1,0,3,'Dunter','',3,'',0,1,'2012-03-12 09:04:56'),(16,11,2,2,2,1,'','Guerrilla Fetish Photography and the Law','','A discussion talking about the logistics involved with doing fetish/bondage photography in public settings. How to find locations for a shoot, how to find photography laws for your city, how to deal with the appearance of law enforcement etc.','A discussion talking about the logistics involved with doing fetish/bondage photography in public settings. How to find locations for a shoot, how to find photography laws for your city, how to deal with the appearance of law enforcement etc.','','01:30:00',NULL,1,0,4,'Dov','Digital Projector',3,'i think this could either work as a class or a panel, there are many fetish photographers that take photos in public settings (i.e. Dov, Murphy Blue, David Lawrence and others) and there are people out there that would like to know how that works.',0,1,'2012-01-13 13:13:30'),(17,3,11,4,2,1,'','Dates of 2012 Flea','','','I have not attended a winter Flea since it moved to the Valentines Day weekend.  It would be nice for those people out there whose partners are in more than one romantic relationship to have the Flea on a weekend other than the Valentines Day weekend.','','00:00:00',NULL,1,0,4,'','',4,'',0,0,'2011-11-03 23:57:30'),(18,12,1,2,2,1,'','Femdom Panel','','Curious about female domination, or femdom? Come hear our panelists talk about maintaining dominance, what dominant women like and don\'t like, and more!','Curious about female domination, or femdom? Come hear our panelists talk about maintaining dominance, what dominant women like and don\'t like, and more!','','01:30:00',47,1,0,4,'','',3,'',0,0,'2012-02-26 23:04:23'),(19,6,2,2,2,1,'','Tickling','','','There was a class last year lead by Footplay210 / P.E.T.E. on tickling that I think was a great success! I\'d love to see this class at the Flea again.  Not many people understand the impact of tickling as sensation play.  ','','01:30:00',NULL,1,0,7,'P.E.T.E.','',8,'http://fetlife.com/users/85240 - Footplay on Fetlife :)  \r\n\r\nThank you! ',0,1,'2011-11-02 14:33:49'),(20,10,2,2,2,1,'','Microbondage','','','I attended a class lead by http://fetlife.com/users/55044 RopeBoi at the Seacoast kinky con.  It was amazing and she did some really cool foot bondage.  Would love to see this type of microbondage again. ','','01:30:00',NULL,1,0,7,'RopeBoi','',1,'',0,1,'2011-11-02 14:33:49'),(21,4,8,2,2,1,'','Leather Tastings','','','Portland, OR does this during their Leather Pride Week.   I think it would be a great fit for the flea:\r\n\r\nThe basic idea is to have a variety of types of play for people to try out. (Depending on how big the space is): there could be a wax play space set up, bondage, flogging, ect.  Gives people a more hands on approach on trying different types of play.\r\n','','01:30:00',NULL,1,0,1,'','',1,'I would be more than willing to help; set up, man, ect.',0,0,'2011-10-27 03:25:16'),(22,10,2,2,2,1,'','Jay Wiseman','','','Take your pick, he\'s got lots of great classes\r\n\r\n(general suggestion to bring Jay Wiseman)','','01:30:00',NULL,1,0,4,'','',1,'More appropriate for \"Suggest a Presenter\" not \"Suggest a Session\"',0,1,'2011-11-02 14:33:49'),(23,10,2,2,2,1,'','Midori','','','Lots of fun rope with her!\r\n\r\n(general suggestion for Midori)','','01:30:00',NULL,1,0,4,'','',1,'More appropriate for \"Suggest a Presenter\" not \"Suggest a Session\"',0,1,'2011-11-02 14:33:49'),(24,10,2,2,2,1,'','Lee Harrington','','','So many wonderful classes - rope, spirituality, you name it! And beautiful performaces as well PLUS Lee\'s in NY now, not so far to travel!\r\n\r\n(general suggestion to feature classes from Lee Harrington at the Flea)','','01:30:00',NULL,1,0,4,'','',1,'More appropriate for \"Suggest a Presenter\" not \"Suggest a Session\"',0,1,'2011-11-02 14:33:49'),(25,11,2,2,2,1,'','Jeff Mach','','','I think he would make a wonderful speaker. Not sure about the topic but I bet he\'d make it interesting and fun\r\n\r\n(General suggestion to feature Jeff Mach at the Flea)','','01:30:00',NULL,1,0,4,'','',1,'He is running his event the next weekend.  He is perpetually unavailable to us for this, unless and until something shifts.',0,1,'2011-11-02 14:33:49'),(26,9,2,2,2,1,'','Going Deep: Punching & Deep Impact','','','A primal and intimate form of play, punching requires you to bring nothing more than an open mind, yet the results can be more erotic and transformative than the most expensive whip. This hands on class will cover the basics, safety, and technique as well as rhythm, breathing, and connection. With these tools you\'ll have the opportunity to experience pain, pleasure, and catharsis. Bring a partner to practice with, be prepared to pair up with a stranger, or hold out \'till the end to practice on Jim, but you will get the opportunity to try out what you learn, I promise! In addition to punching, some other forms of deep impact with be touched upon, including kicking, truncheons, and SAP gloves.','','01:30:00',NULL,1,0,9,'Jim Deuder','',1,'I thought Jim Deuder\'s class was strong as a presenter and as a class. A possible hands-on replacement (so we don\'t have it 3 times in a row, which I know we try to avoid repeats) for Thug Play? Plus having Jim for something bootblacky?',0,1,'2011-11-02 14:33:49'),(27,9,2,2,2,1,'','Face Play','','','Face play enters an intriguing \"taboo\" area by engaging SM techniques above the collarbone. The edge of having an area of the body that is normally highly protected and rarely left vulnerable, the edge of wondering if anything will show the next day and wondering what people would think, what you would think, is a remarkable adrenalin rush. Face play definitely enters the realm of the R.A.C.K. experience as primary concerns are reducing risk as much as possible while being highly aware of the increased risks associated with this area, and the delicious variety that one can enjoy. This is a play style that lends itself well to the limited budget -- and those with limited space as an intense face play scene can be created almost instantly with small tools and imaginative techniques.\r\n\r\nCome learn, and experience the dynamics of playing above the collarbone: facial percussion (Including open and closed hands), caning, flogging, piercing, pressure points, waxing and more will be discussed and demonstrated, with time for practice and personal interaction