users are welcome in this class, we only ask that you practice at your own speed. Advanced users are certainly welcome to come and share some of the more unique ways that you\'re playing with whips.','','01:30:00',NULL,1,0,4,'WhipMaster Bob & BootPig','',1,'I think this class would present a slightly different perspective on whips classes and that whip enthusiasts ranging from beginner to advanced would appreciate this class.  Please bring WhipMaster Bob and BootPig to present at the Flea, on this or any topic.',0,1,'2011-11-02 14:33:49'),(29,11,2,2,2,1,'','Congratulations, You Qualify for an Upgrade!','','',' \"Congratulations, you qualify for an upgrade!\" Isn\'t that a great sentence? An upgrade to first class. An upgrade to a suite. That extra little step of luxury that soothes, rejuvenates, or just gives that little sense of privilege and pampering. We get excited when we have enough miles, enough points, enough nights to get those extras. What if the extras became part of each day? Refining service is a two-way street. Developing an eye for higher levels of service takes time, and practice. For bottoms, it may take awhile, or examples, or ideas to get started with how to create an environment. For tops, the same thing, sometimes you don\'t know what you want if you haven\'t had it yet. There\'s a neatly made bed, and then there\'s the bed with the extras. Turned back? Warmed? Scented? This is just a simple example.?? Come together for practical ideas on how to walk through your routines and generate your own upgrades. If you\'re single, you can start working on the upgrades you would want from your service person. If you\'re a developing service person, add to your repertoire now. Practical also means budget conscious. I\'m on a budget too, so I\'m not talking about how to spend a ton of money. Anyone can do that. This is about nuance, refinement, escalation, exquisite attention to detail and crafting sensory experiences. Let\'s talk about how to experience the finer things, and how to translate those into your own world, complete with your own preferences. We\'ll discuss headspaces, but this is less theory and more practice. Ideas you can take away, and start using this night, right at the event. This is embracing the indulgence and privilege of service. As always, please feel free to contact BootPig in advance at wmb.bootpig@gmail.com if you have specific questions or areas you hope to see addressed.','','01:30:00',NULL,1,0,4,'WhipMaster Bob & BootPig','',1,'This class was presented at Tribal Fire 2011. Please bring BootPig and WhipMasterBob to the Flea!',0,1,'2011-11-02 14:33:49'),(30,9,2,2,2,1,'','Whole Body SM','','','Why stop with backs and asses, breasts and balls? The whole body is a canvas for SM techniques that range from erotic to excruciating. This is a mixed bag of techniques for every area from tip of the head to toes of the feet, beginner to advanced. This is indulging in sensation on every bit of skin available to you. For those of you into long scenes, this helps extend time as you can work all over instead of using up one section of canvas and quitting. Mmmm, can you play with a collarbone? The back of a knee? The small of a back? An eyelash? You can. We\'ll encourage discussion, imagination, and innovation.','','01:30:00',NULL,1,0,4,'WhipMaster Bob & BootPig','',1,'',0,1,'2011-11-02 14:33:49'),(31,5,2,2,2,1,'','Growing a Masochist','','','Surprise! I didn\'t spring forth from the womb of a loving southern woman loving warm ups with bullwhips! I know. You\'re shocked.\r\n\r\nI also didn\'t start out flagging enough fetishes to warrant a magician\'s ribbon of colors. I started out with a list of \"NO WAY NO HOW\" so long that no top could possibly remember it, much less wrap a scene around it. I regularly stated, \"I am not a masochist\". Survey says....nearly 10 years later, yes I am. Happily. Joyfully. Wallowing. Whether you use the term masochist, pain pig, pain slut, or my preferred, pain connoisseur