ll be melted in crockpots and microwave ovens.  Paraffin wax is used with natural hair paint brushes.  Clear shower liners used to protect all surfaces.  I would truly enjoy doing this class.\r\n\r\nThanks for your time.\r\nCountess',0,1,'2011-11-02 14:33:49'),(34,12,2,2,2,1,'','Medical Fun in Public!','','','Learn how you can use medical devices, equipment and supplies to create public play that the vanilla folks won\'t recognize as a power exchange.','','01:30:00',NULL,1,0,4,'','',1,'',0,1,'2011-11-02 14:33:49'),(35,8,2,2,2,1,'','Bucking the Binary of Gender & Orientation','Living in the Grey','Have you been hearing words like “Queer”, “Pansexual”, “Genderqueer”, “Transgender” and wished you could ask what they mean without offending someone? Want to explore the concepts of sex, gender, and orientation in a safe-space where the only wrong question is the one not asked? Whether you left the binary behind years ago or are curious about learning, come join us as we delve into the grey in this judgment-free workshop.','Have you been hearing words like “Queer”, “Pansexual”, “Genderqueer”, “Transgender” and wished you could ask what they mean without offending someone? Want to explore the concepts of sex, gender, and orientation in a safe-space where the only wrong question is the one not asked? Whether you left the binary behind years ago or are curious about learning (but were too afraid to ask), come join us as we delve into the grey in this judgment-free workshop about gender, orientation and living in the undefined.','','01:30:00',NULL,1,0,3,'Aiden Fyre','',1,'Okay so maybe I\'m pro riot. Or just pro-confrontational?',0,1,'2011-12-14 22:23:56'),(36,14,2,2,2,1,'','Spirituality and BDSM','','','I recently attended the NEDS class with Raven Kaldera on spirituality and BDSM. It was excellent and thought-provoking. I recommend he be scheduled for both a classroom and also a round table. ','','01:30:00',NULL,1,0,3,'Raven Kaldera','',1,'Raven\'s website is http://www.ravenkaldera.org/',0,1,'2011-11-02 14:33:49'),(37,12,2,2,2,1,'','Blue - Whom I Thought Was the Best','','','I went to a discussion with Blue as the teacher. He was so informative about your inner sadist. He had his 3 subs with him who were very well versed as well. I think you should have him back for sure. If he comes back that will be a class I will surely take!','','01:30:00',NULL,1,0,4,'Murphy Blue','',1,'I believe this is a request for Murphy Blue\'s Your Inner Sadist class?',0,1,'2011-11-02 14:33:49'),(38,11,2,2,2,1,'','Electricity: Music of the Night ','','','Come see, explore and share the Music of the Night.\r\n\r\nIn this hands on class, Traveling Fool/Jay will show you how, with the use of the Violet Wand and it’s various attachments, we can make great music together. Traveling Fool/Jay will share his musical talents and demonstrate how the bottom can become the band and you, the top, can become the conductor of your own orchestra and create your own “Music of the Night.”','','01:30:00',NULL,1,0,3,'Traveling Fool','',1,'Traveling Fool/Jay is a certified wand demonstrator, member of the Violet Wand Guild and Board member of TES. Traveling Fool/Jay travels the world for work, and plays, demos and teaches at many kink events.',0,1,'2011-11-02 14:33:49'),(39,11,2,2,2,1,'','Consent & Kink','','','BDSM contains a host of nuances, and it\'s not always as simple as \"No Means No\" or \"Yes Means Yes.\" This class will review some of the \"gray\" situations (such as someone touching without permission at a munch, or someone renegotiating mid-scene), how to ensure consent, how to express consent, and what to do if you feel like consent has been disregarded. Participants will develop their own action plans for these scenarios.','','01:30:00',NULL,1,0,9,'TheWindow','',1,'I would be very happy to lead this class and find other presenters. I have a background in peer mental health education and support, and co-lead the Greater Boson Trauma Survivors and Supporters group. ',0,1,'2011-11-02 14:33:49'),(40,11,2,2,2,1,'','Recovering from Trauma, Abuse, and Bad Scenes','','','This class will help participants identify the difference between \"top/sub-drop\" and bigger issues of depression, anxiety, and PTSD. We will discuss effective coping strategies informed by cognitive behavioral therapy, dialectical behavior therapy, mindfulness, and the power of friends and ice cream.','','01:30:00',NULL,1,0,9,'TheWindow','',1,'I would like to teach this class and can find other presenters. I have a background in peer mental health education and co-lead the Greater Boston Trauma Survivors & Supporters group.',0,1,'2011-11-02 14:33:49'),(41,11,1,2,2,1,'','Playing Safe with a Trauma Past: a Workshop for All','','','A panel discussion focusing on how to play safely with someone with a trauma history, anxiety, PTSD, or other life experiences that could be potentially triggering.  Talking about how to communicate, de-escalate, tips for coping, red flags, knowing your triggers and your partners and having a plan, as well as resources that are available.  This could be recent or old trauma, vanilla or kinky.','','01:30:00',NULL,1,0,4,'','',1,'I have spoken to a member of the Greater Boston Trauma Survivors and Supporters, Cory_Alexi about working no something like this.  I don\'t know if they are still interested in the project.  I also think Network/La Red would be a good resource and if there are mental health practitioners that have experience in the kink community that would also be helpful.',0,0,'2011-10-27 01:00:22'),(42,5,13,7,2,1,'','Early Load In','','First block, Load in, Double Credit','First block, Load in, Double Credit','Only assign appropriate, trustworthy people.','02:00:00',5,1,1,12,'','Make sure Loading Dock is open',4,'',0,1,'2011-12-05 10:31:08'),(43,16,14,7,4,1,'','Volunteer Coordinator - 10am Fri','','Coordinate where all individuals are actually going to be, mostly from the Doors and Floors Pool.','Coordinate where all individuals ar