e. We\'ll define headspace and discuss ways to achieve it more readily and what we can do to recapture if it slips away during a scene, and what effects headspace can have on us physiologically, psychologically and even spiritually.  We\'ll be doing a few exercises and demonstrations, so bring rope!','You\'ve heard about rope headspace but you\'ve never been able to achieve it.  You\'ve zoned out while in rope before and want to learn more about what you experienced.  This class is an investigation into that ephemeral altered state.  We\'ll define what headspace is and - just as importantly - what it isn\'t.  We\'ll discuss ways to achieve it more readily and what we can do to recapture if it slips away from us during a scene.  We\'ll also outline what effects headspace can have on us physiologically, psychologically and even spiritually.  We\'ll be doing a few exercises and demonstrations, so bring rope!','','01:30:00',33,1,0,3,'DeLano','',3,'',0,1,'2012-02-26 23:22:31'),(125,10,2,2,2,1,'','The Bottom Line: Rope Bottoming Basics for Brand New Bottoms. ','','','You see the rope, you think you want the rope, but you’ve never been tied.  This class is for absolute beginner bondage bottoms that are curious about rope but need a safe place to break the ice.  If you have questions, concerns or preconceived notions about rope bondage bottoming, bring them to this class!  We’ll answer the questions, address the concerns and obliterate (or confirm) the preconceived notions.  \r\n\r\n ','','01:30:00',NULL,1,0,3,'DeLano','',1,'This is one of the classes DeLano taught at Rope Camp.  I was told by many  people that it was amazing...   ',0,1,'2011-11-02 14:33:49'),(126,11,2,2,2,1,'','RACK Role-Play: What Would YOU Do?','','','Modeled after the EMT Certification Practical Test, this class will present several role-playing bondage scenarios with “problems.” Various class members will be given the opportunity to role-play their reactions and solutions to the problems, followed by constructive discussion by the entire class facilitated by Graydancer. The goal is to provide a more visceral experience for tops and bottoms to identify potential issues in rope bondage and creatively develop strategies for solving them. Entertaining and often surprising, this class provides attendees with new insights into their own kink abilities.','','01:30:00',NULL,1,0,3,'Graydancer','',8,'',0,1,'2011-11-02 14:33:49'),(127,9,2,2,2,1,'','Maximum Impact','','','Impact play and paddles in particular have been getting a bad rap these days as \"not edgy\". Physics say otherwise.\r\n\r\nOver the last 10 years or so I have been making paddles for friends and acquaintances. In that time I have learned that each paddle has its own personality based on the shape and type of wood I have made it from. But one of the other things I have learned over the years is that a paddle can be one of the most brutal toys around.\r\n\r\nA lot of people use paddles at about half to 25% of what they can get out of it. This means that with more effort, you are getting less impact and wearing yourself out sooner than you need to.\r\n\r\nIn this class we will be going over my patent pending technique. Using physics (there is math involved, however it is simple and easy to understand) we will not only learn how to paddle for maximum impact, but we will also be going over the math to help explain why small changes in technique create large changes in the amount of force. We will be learning how to stage the shots to allow for the strike to have exactly the amount of impact you want from slight to near oppressive.\r\n\r\nSo it does not matter if you are a football player or a very slightly built person, this class will help you gain power in your paddles to ensure that you have the bottoms attention whenever you want it.\r\n','','01:30:00',NULL,1,0,3,'DaSade','',1,'',0,1,'2011-11-02 14:33:49'),(128,12,2,2,2,1,'','SUBvert the DOMinant Paradigm: Alternative Models for D/S Relationships ','','','L