01:30:00',NULL,1,0,3,'DaSade','',1,'',0,1,'2011-11-02 14:29:45'),(133,8,1,2,2,1,'','Be a Man','','','This is a panel discussion to discuss what it means to be a masculine dominant. This panel is geared towards anyone who identifies in the scene as masculine (i.e. cis male, trans male, butch, etc.)\r\n\r\nIn tribal cultures, there was no need to explain what it meant to be a \"man\". Children grew up around examples of manhood and were able to absorb those examples and emulate them so that they could find their place in society. Unfortunately, since those days, that message has become diluted. Men have been given conflicting information about what \"male\" means. \r\n\r\nIn this panel discussion, we will be discussing what it means to be a \"man\" and how that influences our BDSM relationships. ','','01:30:00',NULL,1,0,10,'DaSade','',1,'',0,0,'2011-11-02 12:57:19'),(134,11,2,2,2,1,'','ApocalyptaKink Workshop: When Sh*t Happens','','Modeled after the EMT Certification Practical Test, this class will present several role-playing kink scenarios with problems.  Various class members will be given the opportunity to role-play their reactions and solutions to the problems, followed by constructive discussion by the entire class facilitated by Graydancer.','Modeled after the EMT Certification Practical Test, this class will present several role-playing kink scenarios with â€œproblems.â€ Various class members will be given the opportunity to role-play their reactions and solutions to the problems, followed by constructive discussion by the entire class facilitated by Graydancer. The goal is to provide a more visceral experience for tops and bottoms to identify potential issues in rope bondage and creatively develop relevant protocols and strategies for solving them. Entertaining and often surprising, this class provides attendees with new insights into their own kink abilities.','','01:30:00',33,1,0,9,'Graydancer','Ideally it would have a classroom with chairs in a circle a