0',NULL,1,0,3,'','',1,'Bio - info\r\nSirs_Miss_Cindy has been in the BDSM lifestyle for close to 4 years. She is a switch. But she is also collared submissive to Sir Red for 3 years  and is part of a leather family.\r\nShe is an active part of Femdom New England. She hosts their munch every month. She helps schedule speakers for their night at the Society.\r\nShe is also an active member of the Society and of WMPE.\r\nShe has hosted the FemDom panel at the Flea for the past 2 years, and it has grown every year.',0,0,'2011-11-29 20:41:49'),(281,14,10,2,2,1,'','Kabalat Shabbat','','Come and join us Friday night for song and worship! This is a Hebrew heavy event, but you can sing or hum along as you\'d like. Prayer books with transliterations and translations will be provided. Bring short readings or thoughts that you\'d like to share with the rest of the group if you\'d like. Come to pray, or just come to see what it\'s about. You do not have to be Jewish, or even kind of Jewish. If you enjoy worship in song, please come.','Come and join us Friday night for song and worship! This is a Hebrew heavy event, but you can sing or hum along as you\'d like. Prayer books with transliterations and translations will be provided. Bring short readings or thoughts that you\'d like to share with the rest of the group if you\'d like. Come to pray, or just come to see what it\'s about. I can guarantee a quiet, beautiful beginning to an exciting weekend. Then, feel free to join us on Saturday night for Havdalah. You do not have to be Jewish, or even kind of Jewish. If you enjoy worship in song, please come.','','01:30:00',NULL,1,0,9,'LoMevina','',3,'This is an interactive event; people come together to sing and pray and find a space for sacredness within the larger community of the Flea.',0,0,'2012-01-17 16:04:34'),(282,14,10,2,2,1,'','Havdalah','','Join us for the traditional end of Sabbath prayers, as we welcome the start of the rest of the week, and as we move our headspace from som