42,1,0,9,'','',3,'',0,1,'2012-02-27 17:28:42'),(509,11,2,2,2,1,'','Discover your Queer Identity','','Do you identify as queer? Have you considered adopting the \"queer\" label, but weren\'t quite sure how it might apply to your life? If so, please join us as we explore the sexual, political, and social aspects of queer culture. Utilizing a \"Queer Cultural Brainstorm\" tool, this workshop will involve small and larger group facilitated discussion as well as writing activities for reflection.','Do you identify as queer? Have you considered adopting the \"queer\" label, but weren\'t quite sure how it might apply to your life? (Or do you just want to meet and possibly pick up other like-minded queer folks at the event?) If so, please join us as we explore the sexual, political, and social aspects of queer culture. During this interactive discussion, we hope to provide participants with increased awareness and empowerment around their sexual identity and culture. Utilizing a \"Queer Cultural Brainstorm\" tool, this workshop will involve small and larger group facilitated discussion as well as writing activities for reflection.','','01:30:00',10,1,0,3,'Lqqkout & Elizabetha','',3,'',0,1,'2012-03-12 08:31:54'),(510,11,2,2,2,1,'','Fucking With Your Camera','','This class is for photographers and models who want to learn more about what goes in to making good erotic photographs. We\'ll talk a little tech, but mostly we\'ll focus on the emotional and creative aspects of producing erotica. ','This class is for photographers and models who want to learn more about what goes in to making good erotic photographs. We\'ll talk a little tech, but mostly we\'ll focus on the emotional and creative aspects of producing erotica. Some of my work is here.','','01:30:00',45,1,0,3,'roperider','',3,'',0,1,'2012-03-12 08:59:34'),(511,17,2,2,2,1,'','Traveling the Yellow Brick Road of Kink','How to Avoid The Flying Monkeys Along the Road to Oz.','There are literally THOUSANDS of sites online to