ploring their kink in a way that they\'ve never had access to before. Very often that online experience is disappointing when translated to real life. This presentation talks about how to sift through the information, recognize fact from opinions, discuss profiles (the good, the bad, and the ugly), information about privacy and how to use some of the more popular sites to begin to find what you’re looking for whether online or in real life.','','01:30:00',16,1,0,3,'Silverdreams','',3,'',0,1,'2012-03-12 09:08:55'),(512,11,2,2,2,1,'','Erogenous Zoning Violations','','If the media insists on calling our gatherings \"Sex Parties\" I say we have some sex! This class is about dungeon sex! No matter what the restrictions of the play space, we are going to get off! We will demonstrate in glorious detail all the various forms of dungeon sex that are a go at THIS EVENT. Includes strap-on play, public masturbation, tips for overcoming stage fright, and individual erogenous zone mapping.','If the media insists on calling our gatherings \"Sex Parties\" then I say we have some sex! This class is about dungeon sex! No matter what the restrictions of the play space, we are going to get off! We will demonstrate in glorious detail all the various forms of dungeon sex that are a go at THIS EVENT. Includes strap-on play, public masturbation, tips for overcoming stage fright, and individual erogenous zone mapping.','','01:30:00',50,1,0,9,'Danielle DV8','massage table, tarp, chucks',3,'',0,1,'2012-03-12 09:06:17'),(513,11,2,2,2,1,'','Catheters and Sounds','','This class covers the insertion of urinary catheters and sounds, male and female. There is discussion of the use of this play in power transfer (D/s, M/s and others).   It includes a demonstration and hands on participation (when applicable).  It also covers safety. ','This class covers the insertion of urinary catheters and sounds, male and female. There is discussion of the use of this play in power transfer (D/s, M/s and others).