any Meets and BoF\'s at the Winter Flea. My only request is that you DO NOT assign me to the room off the Centro restaurant on the 2nd floor. I\'ve been given that room on multiple ocassions now and it hasn\'t worked for any of them. There\'s usually at least one group that plans a meet in the lounge area of the Centro and people confuse this with that room. \r\n\r\nAlso, I\'m volunteering on Sat. from 12-2 and on Sunday from 1-3 but any other time during either day is fine. \r\n\r\nThank you. ',0,0,'2012-01-16 17:47:18'),(528,3,11,3,5,1,'','Power Play Load In','','Load in for Camryn Moore\'s Power Play','Load in for Camryn Moore\'s Power Play','Camryn Moore','00:45:00',NULL,1,0,5,'','She and her crew are doing this herself.',3,'',0,1,'2012-01-27 01:33:42'),(529,3,11,3,5,1,'','Power Play Load Out','','Load out of Power Play','Load out of Power Play','Cameryn Moore and staff','00:30:00',NULL,1,0,5,'','She and her crew are handling this.  They MUST be done by 8, and will probably need to be checked on.',3,'',0,1,'2012-01-27 01:33:42');
