INSERT INTO `TaskList` VALUES (1,'120','2011-01-29 01:36:00','Make Tasklist','<UL>\r\n  <LI> Database table added\r\n  <LI> New task (with a -1) added\r\n  <LI> Update existing task added\r\n  <LI> Generic adds added.\r\n  <LI> Tested\r\n</UL>\r\n',NULL,'2011-01-30','Y','2011-01-30'),(2,'123','2011-01-30 01:08:00','Packet Contents','<P>Presenters:\r\n<UL>\r\n  <LI> Personal Schedule\r\n  <LI> Wristbands (for them and their guest(s))\r\n  <LI> Welcome Letter\r\n  <LI> Program\r\n  <LI> Nametag\r\n  <LI> Tent (if they are on a panel)\r\n  <LI> Paperwork for NELA Associates card\r\n  <LI> Label (for the outside of the envelope)\r\n</UL></P>\r\n\r\n<P>Volunteers:\r\n<UL>\r\n  <LI> Personal Schedule\r\n  <LI> Definition of Jobs\r\n  <LI> Class intros\r\n  <LI> Wristbands\r\n  <LI> Welcome Letter\r\n  <LI> Label (on the outside of the envelope)\r\n  <LI> Promise of working 4 hours form\r\n  <LI> Program\r\n<UL></P>\r\n\r\n<P>We also have the combined Volunteer and Presenter Welcome letter, for those who are both.  They should get one packet with everything.</P>','0000-00-00','2011-02-06','P',NULL),(7,'120','2011-02-03 04:00:05','Survey Monkey surveys','Set up the 4 surveys on survey monkey',NULL,'2011-02-06','N',NULL),(8,'120','2011-02-03 04:00:44','Paper surveys','Set up the paper surveys:\r\n<UL>\r\n  <LI>Friday (198 filled in at 36) - 300\r\n  <LI>Saturday (Day) (585 filled in at 36) - 650\r\n  <LI>Saturday (Evening) (557 filled in at 36) - 650\r\n  <LI>Sunday (371 filled in at 36) - 500\r\n</UL>','2012-02-06','2012-02-07','N',NULL),(9,'123','2011-02-07 01:31:35','Green Room Supplies','<ul><li>Presenter packets</li>\r\n<li>Presenter handouts</li>\r\n<li>Wristbands</li>\r\n<li>Laser printer</li>\r\n<li>Reams of paper</li>\r\n<li>Golf pencils</li>\r\n<li>Time indicator signs</li>\r\n<li>Feedback forms</li>\r\n<li>Completed feedback form holder</li>\r\n<li>Pens</li>\r\n<li>Pencils</li>\r\n<li>Stapler</li>\r\n<li>Rubber bands</li>\r\n<li>Stapler</li>\r\n<li>Staples</li>\r\n<li>Paper clips</li>\r\n<li>Binder clips</li>\r\n<li>Scotch tape</li>\r\n<li>Spare scotch tape rolls</li>\r\n<li>Masking tape</li>\r\n<li>Spare clipboards</li>',NULL,'0000-00-00','N',NULL),(10,'225','2011-12-14 01:28:37','Add these panels','','2011-12-13','2012-12-14','Y','2011-12-14'),(11,'120','2012-02-04 16:28:23','To be bought for FFF38','<UL>\r\n<LI> Saran Wrap brand, food-safe, colored, plastic wrap\r\n<LI> Index cards - 500\r\n<LI> Good Cookies - For Maggie\r\n<LI> Staples\r\n<LI>Thank-you note cards and envelopes\r\n<LI>Clear painters Tarp for Chocolate Class\r\n<LI>Tarps for other classes (how many?)\r\n<UL>','2012-02-04','2012-02-06','N',NULL),(12,'120','2012-02-22 22:59:54','Tabulation of leftover supplies','<UL>\r\n  <LI> Mess of golf-pencils\r\n  <LI> Friday left-over feedback ~85\r\n  <LI> Saturday Early left-over feedback ~200\r\n  <LI> Saturday Late left-over feedback ~60\r\n  <LI> Sunday left-over feedback ~25\r\n  <LI> (unopened) box of staples\r\n  <LI> half-box of paper-clips\r\n  <LI> Mess of postit-notes\r\n  <LI> Mess of pens and pencils\r\n  <LI> Half-ream of standard paper\r\n  <LI> Half-thing heavy paper\r\n  <LI> Very Little parchement paper\r\n  <LI> ~250 badge-holders\r\n  <LI> ~75 blank badges\r\n  <LI> 5 drop-cloths\r\n  <LI> Roll duct tape\r\n  <LI> Roll masking tape\r\n  <LI> 4 rolls of saran wrap\r\n  <LI> 74 Manila envelopes\r\n  <LI> 9 (down from 12) 10 minute warnings\r\n  <LI> 6 (down from 10) 5 minute warnings\r\n  <LI> Box of file folders\r\n  <LI> 300 lables\r\n  <LI> untouched ream heavy paper\r\n  <LI> White out\r\n  <LI> Box of thank-you cards\r\n  <LI> 300 3x5 cards\r\n  <LI> bag of rubber bands\r\n  <LI> box of bandaids\r\n  <LI> mostly empty bottle of ibuprophen\r\n  <LI> glue stick\r\n</UL>','2012-02-22','2012-02-24','P',NULL);
